        public static List<int> idsCategorias = Categorias.Values.Select(v => v.CategoriaId).ToList();
        public static List<int> idsDepEletronicos = Categorias.Values.Where(c => c.Departamento == TipoDepartamento.Eletronicos).Select(v => v.CategoriaId).ToList();
        public static List<int> idsDepMovies = Categorias.Values.Where(c => c.Departamento == TipoDepartamento.Moveis).Select(v => v.CategoriaId).ToList();
        public static List<int> idsDepAlimentos = Categorias.Values.Where(c => c.Departamento == TipoDepartamento.Alimentos).Select(v => v.CategoriaId).ToList();
        public static List<int> idsDepRoupas = Categorias.Values.Where(c => c.Departamento == TipoDepartamento.Roupas).Select(v => v.CategoriaId).ToList();


        public static bool ChecarSeCategoriaExiste(string categoria)
        {
            return Categorias.ContainsKey(categoria);
        }
        public static bool ChecarSeIdCategoriaExiste(int idCategoria)
        {
            return idsCategorias.Contains(idCategoria);
        }

        public static bool ChecarSeIdCategoriaExisteFromDictionary(int idCategoria) 
        {
            return Categorias.Any(c => c.Value.CategoriaId == idCategoria);
        }

        public static int BuscarIdCategoriaPorTexto(string categoria)
        {
            if(Categorias.TryGetValue(categoria, out var econtrado))
            {
                return econtrado.CategoriaId;
            }

            return 0;
        }
        public static bool CategoriaPetenceAoDepartamento(TipoDepartamento departamento, string categoria)
        {
            if (Categorias.ContainsKey(categoria))
            {
                return Categorias.Any(c => c.Value.Departamento == departamento);
            }
            return false;
        }
        public static bool IdCategoriaPertenceAoDepartamento(TipoDepartamento departamento, int idCategoria)
        {
            switch (departamento)
            {
                case TipoDepartamento.NaoDefinido:
                    return idsCategorias.Contains(idCategoria);
                case TipoDepartamento.Roupas:
                    return idsDepRoupas.Contains(idCategoria);
                case TipoDepartamento.Alimentos:
                    return idsDepAlimentos.Contains(idCategoria);
                case TipoDepartamento.Eletronicos:
                    return idsDepEletronicos.Contains(idCategoria);
                case TipoDepartamento.Moveis:
                    return idsDepMovies.Contains(idCategoria);
                default:
                    return false;
            }
        }

        public static bool IdCategoriaPertenceAoDepartamentoFromDictionary(TipoDepartamento departamento, int idCategoria)
        { 
            return Categorias.Any(c => c.Value.Departamento == departamento && c.Value.CategoriaId == idCategoria);
        }

    }

